import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Click on Electronics category to get to a page with view toggle
    await page.waitForSelector('text=Electronics', { timeout: 5000 });
    await page.click('text=Electronics');

    // Wait for page to load and take screenshot
    await page.waitForLoadState('networkidle');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_category_page.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_category_page.png'));

    // Wait for and click the list view toggle button
    await page.waitForSelector('.view-toggle .view-btn[title="List View"]', { timeout: 5000 });
    await page.click('.view-toggle .view-btn[title="List View"]');

    // Wait for view change and take screenshot
    await page.waitForTimeout(1000); // Brief pause for UI update
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_list_view.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_list_view.png'));

    // Verify list view is active by checking for list view specific classes
    const listViewActive = await page.$eval('.view-toggle .view-btn[title="List View"]', 
      el => el.classList.contains('active'));

    const hasListLayout = await page.$eval('.products-list', el => el.offsetParent !== null);

    return {
      success: true,
      action: "Switched to list view mode successfully",
      extractedData: {
        listViewActive: listViewActive,
        listLayoutVisible: hasListLayout
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to switch to list view mode",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
